  console.log(searchText, "this is the default");

  setTimeout(() => {
    setSearchText("NewText")
  console.log(searchText, "this is the dNew");
  }, 2000);
  return (
    <div>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<AboutView />} />
        <Route path="/search" element={<SearchView />} keyword={searchText} seachResult={seachResult}/>
        {/* <AboutView /> */}
      </Routes>
    </div>
  );
}

export default App;
